import { Row, Col } from "react-bootstrap"

const CollectionOne = () => {
  return (
    <Row className="row-section collection-section collection-one-section">
      <Col as="a" style={{"backgroundImage": "/image/CollectionOne/CollectionOne_1.jpg"}}></Col>
      <Col as="a" style={{"backgroundImage": "/image/CollectionOne/CollectionOne_2.jpg"}}></Col>
      <Col as="a" style={{"backgroundImage": "/image/CollectionOne/CollectionOne_3.jpg"}}></Col>
      <Col as="a" style={{"backgroundImage": "/image/CollectionOne/CollectionOne_4.jpg"}}></Col>
    </Row>
  )
}

export default CollectionOne
